import { Card, CardContent } from "@mui/material";
import React, { useEffect } from "react";
import axios from "axios";
require('dotenv').config();
function ShoppingCart() {
  let movieAPI = "https://api.themoviedb.org/3/genre/movie/list/?";
  let movieData = async () => {
    try {
      let response = await axios.get(movieAPI+ process.env.API_KEY);
    //   let json = response.json();
      console.log(response);
    } catch (err) {
      console.error(err, "err");
    }
  };
  useEffect(() => {
    movieData();
  }, []);

  return (
    <div>
      <h2>Shopping</h2>
      <div style={{ display: "flex", justifyContent: "space-between" }}>
        <div style={{ width: "70%" }}>cards</div>

        <div style={{ width: "30%" }}>
          <Card>
            <CardContent>
              <h3>Checkout</h3>
              <h3>Item name</h3>
              <h5>Quantity</h5>
              <h5>Price</h5>
              <h5>Total</h5>
            </CardContent>
          </Card>
        </div>
      </div>
    </div>
  );
}

export default ShoppingCart;
